import './company.scss'
import SiteHeader from '../../components/SitesHeader/SiteHeader.component'
const Company = () => {
    return (
      <div id='section' className='company'>
        <SiteHeader siteHeader={'COMPANY'}/>
        <div className='company-first-row'>
          <div className='side-row-header'></div>
          <div className='row-content'>df</div>
        </div>
      </div>
    );
  }
  
  export default Company;
